('[DIE-144/2024] Alumnat: canvi de centre escolar / IES Calvià [07007899] - Santa Ponça', 'Alumnat: canvi de centre escolar', '2024-02-12', 'Sortida Secretaria', 'IES Calvià [07007899] - Santa Ponça', 'Margalida Coll Llompart', '[Phoebe Olivia Hodgson]', NULL, NULL, NULL, 'L\'alumna Phoebe Olivia Hodgson que cursa primer d\'ESO a l\'IES Calvià se li ha incoat un expedient disciplinari amb resolució del director de canvi de centre. La resolució ha estat notificada a la mare, qui ha expressat conformitat i ha renunciat al termini d\'al·legacions.\r\n\r\nD\'acord amb l\'article 58 del Decret 121/2010 `aquesta mesura només es pot adoptar de manera excepcional i sols es pot fer efectiva quan la Conselleria d’Educació i Cultura hagi assignat a l’alumne una plaça escolar en un altre centre docent, de conformitat amb la normativa vigent en matèria d’admissió d’alumnes a centres docents sostinguts amb fons públics`.\r\n\r\nPer tant, us sol·licit que se li adjudiqui una plaça a un centre amb existència de vacants proper al domicili de l\'alumna.\r\n\r\n\r\n\r\nMargalida Coll Llompart\r\nInspectora d\'educació\r\nExtensió 66497\r\nmcoll@die.caib.es', 'No', 'No', NULL, 'Departament d\'Inspecció Educativa', 'Departament d\'Inspecció Educativa', NULL, 'Tema:12/02/2024 s\'inicia expedient d\'ofici a petició de la inspectora Margalida Coll Llompart.', '[12/02/2024 Passat a la inspectora]', NULL),
