('[DIE-1268/2023] Professorat: altres qüestions / IES Berenguer d\'Anoia [07001551] - Inca', 'Professorat: altres qüestions', '2023-11-07', 'Informe inspector', 'IES Berenguer d\'Anoia [07001551] - Inca', 'Catalina Moner Mora', NULL, '[Katarzyna Sylwia Dziegielenska]', NULL, NULL, NULL, 'No', 'No', NULL, 'Servei de Prevenció de Riscs Laborals (Direcció General de Personal Docent)', NULL, NULL, 'Docent que va patir assetjament a un centre i per aquest motiu es va fer un canvi de centre. Ara torna a presentar ansietat i torna a demanar un nou canvi. Aquest nou quadre d\'ansietat es valorat pel Servei de prevenció i comunica a l\'informe que té problemàtica però no derivada directament de la situació laboral sinó d’aspectes\r\npersonals i emocionals d’ella mateixa. Es recomana a la docent realitzar tractament psicològic i psiquiàtric.', NULL, 'Informe del Servei de Prevenció'),
