('[DIE-1210/2022] Professorat: expedient disciplinari / IES Ramon Llull [07003870] - Palma', 'Professorat: expedient disciplinari', '2022-11-18', 'Entrada Secretaria', 'IES Ramon Llull [07003870] - Palma', 'M. Pilar Prohens Mas', NULL, '[Maria Josep Grau Garrigues]', NULL, NULL, NULL, NULL, NULL, NULL, 'Direcció General de Personal Docent i Centres Concertats', NULL, NULL, 'S\'inicia expedient disciplinari per la presumpta infracció disciplinaria lleu per incompliment injustificat de l\'horari de treball i per la presumpta falta greu, per la realització d\'actuacions dirigides a evadir els sistemes de control horari o impedir que siguin detectats els incompliments injustificats de la jornada de treball.\r\n-28/06/2023 es tramet la proposta de resolució al Servei Jurídic de Personal Docent.', '[18/11/2022 Passat a la instructora]', NULL),
('[DIE-1209/2022] Professorat: expedient disciplinari / IES Ramon Llull [07003870] - Palma', 'Professorat: expedient disciplinari', '2022-11-18', 'Entrada Secretaria', 'IES Ramon Llull [07003870] - Palma', 'M. Pilar Prohens Mas', NULL, '[Josep Fillol Sendra]', NULL, NULL, NULL, 'No', 'No', NULL, 'Direcció General de Personal Docent i Centres Concertats', 'Departament d\'Inspecció Educativa', NULL, 'Inici d\'expedient disciplinari per les següents causes: Evadir sistemes de control d\'horari o impedir que sigui detectats els incompliments injustificats de la jornada de treball, i per falta de cura o negligència a l\'exercici de les funcions pròpies.\r\n-6/07/2023 Té entrada al departament nova Resolució de la directora general de Personal Docent per la qual s\'anul·la la proposta de resolució de la instructora.(està a documentació d\'entrada 1)\r\n-17/07/2023 Cal nomenar nou instructor, ja que s\'ha retrotret les actuacions al moment de la Resolució d\'inici i no dona temps a instruir abans de l\'1 de setembre. L\'expedient queda pendent de nomenar un nou instructor per el nou cap d\'Inspecció Educativa.\r\n-04/09/2023 Es nomena nova instructora del procediment a la inspectora Maria Isabel Salas Sánchez. 21/09/2023: Ens arriba la Resolució del director general de personal docent del canvi d\'instructora.\r\n- 07/12/2023 S\'envia sol·licitud d\'informació sobre dos funcionaris interins al cap de servei de secundària.\r\n-11/12/2023 Rebuda la informació demanada per la instructora.\r\n-24/01/2024 S\'envia nota interna de canvi de instructora al Servei Jurídic de Personal Docent, la nova instructora és M.Pilar Prohens.\r\n-26/01-2024 Rebem la Resolució del director general de Personal Docent de canvi d\'instructora, la nova instructora és M. Pilar Prohens.\r\n18/04/2024 S\'envia proposta de resolució de la instructora i l\'expedient complet.\r\n14/05/2024 El servei jurídic de Personal Docent ens fa arribar la Resolució que posa fi al procediment amb data 26/04/2024.', '[18/11/2022 Passat a la instructora, 14/07/2023 Passat a la inspectora nova Resolució de la directora general de Personal Docent, 04/10/2023 Passat a la nova instructora., 12/12/2023 Passata a la instructora, rebuda la informació demanada per la instructora., 14/05/2024 Fi del procediment]', NULL),
