('[DIE-1171/2022] DIE: altres qüestions', 'DIE: altres qüestions', '2022-11-02', 'Finalitzat', 'Altres', NULL, NULL, NULL, NULL, NULL, 'Una vegada revisada la documentació que s’ha de publicar, manifest que és correcta i adequada a dret, també pel que fa al compliment del Reglament (UE) 2016/679 (RGPD), de la normativa espanyola de protecció de dades i de la Circular 1/2003 de la secretària general de la Conselleria de Presidència sobre recomanacions que s’han de tenir en compte en relació amb els documents que contenguin dades de caràcter personal que s’hagin de publicar al BOIB, i que no hi ha cap obstacle jurídic per publicar-la. A més, se n’han revisat lingüísticament les versions catalana i castellana.\r\n\r\nPer això, us sol·licit que signeu digitalment la petició d’enviament de la publicació al BOIB que s’ha donat d’alta a l’aplicació d’enviament d’edictes, de la qual us tramet, adjunta, una còpia:\r\n«Resolució del conseller d’Educació i Formació Professional de 28 d’octubre de 2022 per la qual s’aprova el Programa d’Actuació del Departament d’Inspecció Educativa per al Curs 2022-2023»\r\n\r\nEditora del DIE (persona que ha elaborat i revisat els documents):\r\nCamila Tudurí Vila Extensió: 62119 Adreça electrònica: ctuduri@die.caib.es', 'No', 'No', NULL, 'Departament d\'Inspecció Educativa', 'Secretaria General', NULL, NULL, NULL, 'Sol·licitud d’enviament d’una publicació al BOIB amb l’aplicació d’enviament d’edictes'),
